import React from 'react';
import '../../../App';
import Footer from '../../Footer';
import Cards from '../../Cards';
import Navbar from '../../Navbar';
import './Login-Form.css'


function Login() {
  return (
    <>
    <div className='backg'>
    <Navbar
      NavButtonName='Register'
      NavButtonlink='/registration'/>
      <Cards/>
      <Footer/>
    </div>    
    </>
  );
}

export default Login;
